INSERT INTO `missions` VALUES (1,'Cafe / Bar προσβάσιμα από AμεA','Σε ποια σημεία μπορούν να απολαύσουν οι συμπολίτες μας με αναπηρικό αμαξίδιο τον καφέ ή το ποτό τους; Μοιραστείτε τις καφετέριες και τα μπαράκια που είναι προσβάσιμα. Η Αθήνα είναι γεμάτη τέτοια ωραία μέρη και πρέπει να τα χαίρονται όλοι ανεξαιρέτως. Για ',NULL,'2016-01-22 10:43:46','2016-01-22 10:43:46',NULL,1,'cityrus_O5m8eTmy5t7gkPak'),(2,'Διαδρομές προσβάσιμες από AμεA','Πού μπορούν να κινηθούν με το αναπηρικό αμαξίδιο οι συμπολίτες μας με κινητικές αναπηρίες; Η Αθήνα έχει πάμπολλα σημεία που μπορούν να χρησιμοποιηθούν ως ωραίες διαδρομές για βόλτα, ποια από αυτά είναι εύκολα προσβάσιμα από ΑμεΑ ώστε να μπορούν να απολαύσ',NULL,'2016-01-22 10:43:47','2016-01-22 10:43:47',NULL,2,'cityrus_Ymew99uee5QC5OCS'),(3,'Όμορφες διαδρομές για περπάτημα','Ας απολαύσουμε βόλτες στην πόλη! Για ψώνια, για τη φανταστική θέα, για την ιστορία, για ρομαντζάδα, για να ονειρεύεστε... πού σας αρέσει να περπατάτε; Μοιραστείτε το για να μάθουμε και οι υπόλοιποι αυτά τα υπέροχα μέρη! Και μην ξεχάσετε να μάθετε για νέες',NULL,'2016-01-22 10:43:47','2016-01-22 10:43:47',NULL,2,'cityrus_CN3TL1WsjadDnbn8'),(4,'Όμορφες διαδρομές για τρέξιμο','Η κίνηση είναι ζωή! Το τρέξιμο στην πόλη είναι ολοένα για περισσότερους από εμάς ένας υπέροχος τρόπος να ηρεμήσουμε, να αδειάσουμε το μυαλό μας από έγνοιες, να γυμναστούμε, να αποκτήσουμε αντοχή... Τα οφέλη είναι πάμπολλα και δύσκολα περιγράφονται! Καταγρ',NULL,'2016-01-22 10:43:48','2016-01-22 10:43:48',NULL,2,'cityrus_bOKPS5Sv8G8KR8WJ'),(5,'Όμορφες διαδρομές για ποδηλασία','Το ποδήλατο είναι ελευθερία! Ποιες διαδρομές είναι ωραίες για ποδηλατοβόλτες; Πού σας αρέσει να πηγαίνετε με το ποδήλατο; Και μην ξεχάσετε να μάθετε για νέες διαδρομές για ποδήλατο που έχουν συνεισφέρει άλλοι χρήστες από το χάρτη.',NULL,'2016-01-22 10:43:49','2016-01-22 10:43:49','2016-01-27 10:25:53',2,'cityrus_nYXEN8s8P4PYEcCz'),(6,'Δοκιμαστική αποστολή 1','Αυτή είναι μια όμορφη δοκιμαστική αποστολή! Ναι είναι!',NULL,'2016-01-27 10:24:54','2016-01-27 10:25:53','2016-01-27 10:25:53',1,'cityrus_7Wb5dpS1SGdVS0Jc'),(7,'Scify test mission','Test mission, super secret!',NULL,'2016-01-27 10:31:18','2016-01-27 10:34:54','2016-01-27 10:34:54',1,'cityrus_q1L0y2YwTmmaG6xc'),(8,'Scify test mission','Test mission, super top secret!',NULL,'2016-01-27 10:35:50','2016-01-27 10:37:11','2016-01-27 10:37:11',1,'cityrus_hlwCs4NGtnzYWn88'),(9,'Scify test mission','Test mission, super top secret!',NULL,'2016-01-27 10:35:59','2016-01-27 10:37:08','2016-01-27 10:37:08',1,'cityrus_WR6lkYIW5UbsjXUS');
